import React from "react";
import Card from "@mui/material/Card";
import SoftBox from "components/SoftBox";
import SoftTypography from "components/SoftTypography";
import SoftInput from "components/SoftInput";
import SoftButton from "components/SoftButton";
import { Box, Icon, TextField } from "@mui/material";
import AccountCircle from "@mui/icons-material/AccountCircle";
const Infleta = () => {
  return (
    <Card>
      <SoftBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <SoftBox>
          <SoftTypography variant="h6" gutterBottom>
            ¿Cuotas o Contado?
          </SoftTypography>
          <SoftBox display="flex" gap={1} alignItems="center" lineHeight={0}>
            <Icon
              sx={{
                fontWeight: "bold",
                color: ({ palette: { info } }) => info.main,
                mt: -0.5,
              }}
              fontSize="large"
            >
              price_change
            </Icon>
            <SoftTypography variant="button" fontWeight="regular" color="text">
              <strong> Mejora tu estrategia de pagos: </strong>calcula si te conviene cuotas o pago
              único.
            </SoftTypography>
          </SoftBox>
        </SoftBox>
        <SoftBox color="text" px={2}>
          <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small">
            restart_alt
          </Icon>
        </SoftBox>

      </SoftBox>

    </Card>
  );
};

export default Infleta;
